!
!

!
version 12.4
service timestamps debug datetime msec
service timestamps log datetime msec
no service password-encryption
!
hostname R35
!
boot-start-marker
boot-end-marker
!
!
no aaa new-model
no ip icmp rate-limit unreachable
!
!
ip cef
no ip domain lookup
!
!
!
!
!
!
!
!
!
!
!
!
!
!
!
!
!
!
ip tcp synwait-time 5
! 
!
!
!
!
interface FastEthernet0/0
 no ip address
 shutdown
 duplex half
!
interface FastEthernet1/0
 ip address 11.0.0.35 255.0.0.0
 duplex auto
 speed auto
!
interface FastEthernet1/1
 ip address 12.0.0.35 255.0.0.0
 duplex auto
 speed auto
!
!
router eigrp 134
 redistribute eigrp 191 route-map box9
 network 12.0.0.0
 no auto-summary
!
router eigrp 191
 redistribute eigrp 134
 network 11.0.0.0
 no auto-summary
!
ip forward-protocol nd
!
no ip http server
no ip http secure-server
!
!
access-list 9 deny   192.168.17.64
access-list 9 deny   63.0.0.0 0.255.255.255
access-list 9 deny   132.190.0.0 0.0.255.255
access-list 9 permit any
!
route-map box9 permit 10
 match ip address 9
!
!
!
control-plane
!
!
!
!
!
!
gatekeeper
 shutdown
!
!
line con 0
 exec-timeout 0 0
 privilege level 15
 logging synchronous
 stopbits 1
line aux 0
 exec-timeout 0 0
 privilege level 15
 logging synchronous
 stopbits 1
line vty 0 4
 login
!
!
end
